import React from "react";
import "../App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Filter from "../Components/Filters";
import { Container, Row, Col } from "react-bootstrap";
import avatar from "../assets/avatar.png";
import Cards from "../Components/Cards";

function Proposal() {
  return (
    <>
      <style type="text/css">
        {`
          
        //   .colFilter {
        //     width: 100%;
        //     height: 100%;
        //     position: relative;
        //   }



          `}
      </style>

      <Container fluid className="proposal p-0">
        <Row style={{ margin: "30px 0px 0px 30px" }}  >
          <Col sm={8} className="p-0 ">
            <p className="pr"> Предложения </p>
          </Col>
          <Col sm={3} className="p-0 " style={{ width: "250px" }}>
            <input
              placeholder="Поиск"
              style={{ width: "100%" }}
              className="searchField"
            ></input>
          </Col>
          <Col sm={1} style={{ paddingLeft: "16px" }}>
            <img className="avatar" src={avatar} alt={"avatar"}></img>
          </Col>
          <Row className="p-0 ">
            <Col className="colFilter">
              <Filter />
            </Col>
          </Row>
        </Row>
        <Row xs={1} md={2} style={{ margin: " 30px 0px 0px 30px" }}>
          {/* <Col className="p-0 "> */}
          <Cards />
          {/* </Col> */}
        </Row>
      </Container>
    </>
  );
}

export default Proposal;
